import React from "react";
import "./LargeButton.css";

function LargeButton(props)
{
    
    return(
        <input type="button" 
            value={props.value} 
            
            style={{
                fontSize:props.fontSize, 
                width:props.width, 
                height:props.height,
                borderRadius:props.borderRadius}}
           />
    );
}

export default LargeButton;
